                  <input type="text" className="form-control mb-3 mr-sm-2" id="inlineFormInputName2" placeholder="Your name..."></input>
                  <button type="submit" class="btn btn-primary ml-2">Submit</button>
            </form>
        );
    }
}

export default NameForm;
